import styled from 'styled-components';
import { Link as LinkR } from 'react-router-dom' ;
import { Link as LinkS } from 'react-scroll'; 

export const HomeContainer=styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100vw;
    height: 100vh;

    background-image: url('https://images.unsplash.com/photo-1514477917009-389c76a86b68?ixlib=rb-1.2.1&auto=format&fit=crop&w=1261&q=80');

    background-size: cover;
`;

export const HomeH1=styled.div`
    color: #eee;
    font-size: 60px;
    font-weight: 800;
    line-height: 1.2;
    font-family: 'Open Sans', sans-serif;
`;

export const Homespan=styled.div`
    color:#4B6692;
`;

export const Button=styled.div`
    border:1px solid #FFB2B1;
    border-radius:10px;
`;
